import logo from './logo.svg';
import './App.css';
import landingPage from './pages/landing';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";


function App() {
  return (
    <div>
      <Router>
        <div>
          <Switch>
            <Route exact path="/" component={landingPage} />
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
